// frontend/src/components/FoodForm.js

import React from 'react';
import { Link } from 'react-router-dom';

const FoodForm = ({ fetchFoods }) => {
  // Your existing code for the form

  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '80vh' }}>
      <form onSubmit={handleSubmit} style={{ width: '400px', padding: '20px', border: '1px solid #ccc', borderRadius: '8px' }}>
        {/* Your form fields */}
        <button type="submit">Add Food</button>
        {/* Add a Link to navigate to the AddFoodPage */}
        <Link to="/add">Add Food Page</Link>
      </form>
    </div>
  );
};

export default FoodForm;
